import "./App.css";
import Home from "./component/Home";
import Navbar from "./component/Navbar";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import TreatmentMainPage from "./component/treatment/TreatmentMainPage";


// importing various contaner
import TestContainer from "./TestContainer";
import MedicalIssueContainer from "./MedicalIssueContainer";
import MentalHealthContainer from "./MentalHealthContainer";
import SurgicalProcedureContainer from "./SurgicalProcedureContainer";
import CareAndSupportContainer from "./CareAndSupportContainer";


function App() {
  return (
    <div>
      <Navbar />

      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="Home" element={<Home />} />
          <Route path="/Treatment" element={<TreatmentMainPage />}>
            <Route path="/Test" element={<TestContainer />} />
            <Route path="/MedicalIssue" element={<MedicalIssueContainer />} />
            <Route path="/MentalHealth" element={<MentalHealthContainer />} />
            <Route
              path="/SurgicalProcedure"
              element={<SurgicalProcedureContainer />}
            />
            <Route
              path="/CareAndSupport"
              element={<CareAndSupportContainer />}
            />
          </Route>
          <Route path="Foundations" element={<Home />} />
          <Route path="About" element={<Home />} />
          <Route path="Event" element={<Home />} />
          <Route path="Contact" element={<Home />} />
          <Route path="Carrer" element={<Home />} />
          <Route path="Donate" element={<Home />} />
          <Route path="Search" element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
